import "./car_list.css"

export default function Car_list({img, title}) {
    return (
        <>
            <div className="block_info_car">
                <div className="block_photo">
                    <img src={img} alt=""/>
                </div>
                <div className="block_info">
                    <p>{title}</p>
                    <button
                        onClick={() => {
                            scrollTo(0)
                        }}
                        className="button_order_car"
                    >Замовити машину
                    </button>
                </div>
            </div>
        </>
    )
}

function scrollTo(element) {
    let nameClass = document.querySelector(element)
    window.scroll({
        left: 0,
        top: element,
        behavior: 'smooth'
    })
}
